package com.kayu.business_car_owner.wxapiimport android.text.TextUtilsclass PayResult(rawResult: Map<String?, String?>) {    /**     * @return the resultStatus     */    var resultStatus: String = ""    /**     * @return the result     */    var result: String = ""    /**     * @return the memo     */    var memo: String? = null    override fun toString(): String {        return ("resultStatus={" + resultStatus + "};memo={" + memo                + "};result={" + result + "}")    }    init {        for (key in rawResult!!.keys) {            if (TextUtils.equals(key, "resultStatus")) {                resultStatus = rawResult[key].toString()            } else if (TextUtils.equals(key, "result")) {                result = rawResult[key].toString()            } else if (TextUtils.equals(key, "memo")) {                memo = rawResult[key]            }        }    }}